# %% [markdown] id="ulZKoTtJ3yfA"
# We applied data augmentations to improve generalization and reduce overfitting:
#
# - **Resize (224×224):** Standardizes input size for consistent model input.
# - **RandomRotation (±10°):** Handles wrist angle variability in real X-rays.
# - **RandomHorizontalFlip:** Addresses left/right wrist symmetry.
# - **ColorJitter:** Simulates lighting and contrast variations across devices.
# - **ToTensor & Normalize:** Prepares images to match pretrained model expectations (ImageNet stats).
#
# Validation and test sets remained unaugmented to ensure fair evaluation.

# %% id="f79XPCOtXeOZ"
def get_transforms():
    train_transform = transforms.Compose([
        transforms.Resize((224, 224)),
        transforms.RandomRotation(10),
        transforms.RandomHorizontalFlip(),
        transforms.ColorJitter(brightness=0.2, contrast=0.2),
        transforms.ToTensor(),
        transforms.Normalize([0.485, 0.456, 0.406],
                             [0.229, 0.224, 0.225])
    ])

    val_test_transform = transforms.Compose([
        transforms.Resize((224, 224)),
        transforms.ToTensor(),
        transforms.Normalize([0.485, 0.456, 0.406],
                             [0.229, 0.224, 0.225])
    ])
    return train_transform, val_test_transform


