# ###Training Function

# %% id="WzdqPD130zY5"
def train_model(model, criterion, optimizer, scheduler, num_epochs, patience):
    since = time.time()

    best_val_loss = float("inf")
    best_val_acc = 0.0
    best_acc = 0.0
    best_model_val_acc_wts = copy.deepcopy(model.state_dict())

    epochs_no_improve = 0

    train_acc_hist, val_acc_hist = [], []
    train_loss_hist, val_loss_hist = [], []

    for epoch in range(num_epochs):
        print(f"\nEpoch {epoch+1}/{num_epochs}:\n")
        epoch_results = {}

        for phase in ['train', 'val']:
            model.train() if phase == 'train' else model.eval()
            dataloader = train_loader if phase == 'train' else val_loader

            running_loss = 0.0
            running_corrects = 0

            for inputs, labels in tqdm(dataloader, desc=f"{phase} Epoch {epoch+1}", leave=False):
                inputs, labels = inputs.to(device), labels.to(device)
                optimizer.zero_grad()

                with torch.set_grad_enabled(phase == 'train'):
                    outputs = model(inputs)
                    _, preds = torch.max(outputs, 1)
                    loss = criterion(outputs, labels)

                    if phase == 'train':
                        loss.backward()
                        optimizer.step()

                running_loss += loss.item() * inputs.size(0)
                running_corrects += torch.sum(preds == labels.data)

            epoch_loss = running_loss / len(dataloader.dataset)
            epoch_acc = running_corrects.double() / len(dataloader.dataset)

            if phase == 'train':
                train_loss_hist.append(epoch_loss)
                train_acc_hist.append(epoch_acc.item())
                epoch_results['train_loss'] = epoch_loss
                epoch_results['train_acc'] = epoch_acc.item()
            else:
                val_loss_hist.append(epoch_loss)
                val_acc_hist.append(epoch_acc.item())
                epoch_results['val_loss'] = epoch_loss
                epoch_results['val_acc'] = epoch_acc.item()
                scheduler.step(epoch_loss)
                print(f"Learning Rate: {optimizer.param_groups[0]['lr']:.6f}")

                # Save model if val_acc improved
                if epoch_acc > best_val_acc:
                    best_val_acc = epoch_acc
                    best_model_val_acc_wts = copy.deepcopy(model.state_dict())

                # Early stopping by val_loss
                if epoch_loss < best_val_loss:
                    best_val_loss = epoch_loss
                    epochs_no_improve = 0
                else:
                    epochs_no_improve += 1

        print(f"Train Acc: {epoch_results['train_acc']:.4f} | Val Acc: {epoch_results['val_acc']:.4f} | "
              f"Train Loss: {epoch_results['train_loss']:.4f} | Val Loss: {epoch_results['val_loss']:.4f}")
        print("-" * 60)

        if epochs_no_improve >= patience:
            print(f"Early stopping triggered after {epoch+1} epochs.")
            break

    best_acc = best_val_acc  # for reporting
    print(f"\nBest Val Acc: {best_acc:.4f}")

    # Save model to disk if it improved
    model_name = model.__class__.__name__.lower()
    best_model_path = f"/content/drive/MyDrive/BoneFractureModels/{model_name}_best.pth"
    best_meta_path = f"/content/drive/MyDrive/BoneFractureModels/{model_name}_best_meta.json"

    prev_best_acc = 0.0
    if os.path.exists(best_meta_path):
        with open(best_meta_path, "r") as f:
            try:
                meta = json.load(f)
                prev_best_acc = meta.get("val_acc", 0.0)
            except json.JSONDecodeError:
                print("Warning: Failed to read best_meta.json. Using val_acc = 0.0")

    if best_acc > prev_best_acc:
        torch.save(best_model_val_acc_wts, best_model_path)
        best_meta = {
            "val_acc": best_acc.item() if isinstance(best_acc, torch.Tensor) else best_acc,
            "train_acc_hist": train_acc_hist,
            "val_acc_hist": val_acc_hist,
            "train_loss_hist": train_loss_hist,
            "val_loss_hist": val_loss_hist
        }
        with open(best_meta_path, "w") as f:
            json.dump(best_meta, f)
        print(f"New best model saved with Val Acc: {best_acc:.4f}")

    # Load the best model weights before returning
    model.load_state_dict(best_model_val_acc_wts)
    return model, train_acc_hist, val_acc_hist, train_loss_hist, val_loss_hist



