SAVE_DIR = f"/content/drive/MyDrive/BoneFractureModels/{MODEL_NAME}_GridSearch"
os.makedirs(SAVE_DIR, exist_ok=True)
csv_path = f"{SAVE_DIR}/all_results.csv"

# Load dataset and apply transforms
train_transform, val_test_transform = get_transforms()

train_dataset = datasets.ImageFolder(os.path.join(DATA_DIR, 'train'), transform=train_transform)
val_dataset   = datasets.ImageFolder(os.path.join(DATA_DIR, 'val'), transform=val_test_transform)

# Prepare grid combinations
keys = list(param_grid.keys())
values = list(param_grid.values())
grid_combinations = list(itertools.product(*values))

# Save all results
all_results = []

# Run Grid Search
for i, combo in enumerate(remaining_combos, start_idx):
    config = dict(zip(keys, combo))
    run_id = f"{i:03d}"
    run_name = f"run_{run_id}: " + " ".join([f"{k}: {v}" for k, v in config.items()])
    print(f"\nStarting {run_name}")

    # Create dataloaders
    train_loader = DataLoader(train_dataset, batch_size=config["batch_size"], shuffle=True, num_workers=2)
    val_loader = DataLoader(val_dataset, batch_size=config["batch_size"], shuffle=False, num_workers=2)
    dataloaders = {"train": train_loader, "val": val_loader}

    # Build model with given hyperparameters
    model = build_resnet50(
        dropout=config["dropout"],
        hidden_dim=config["hidden_dim"],
        layers_to_unfreeze=config["layers_to_unfreeze"]
    ).to(device)

    # Define optimizer and scheduler
    optimizer = torch.optim.AdamW(
        filter(lambda p: p.requires_grad, model.parameters()),
        lr=config["lr"],
        weight_decay=config["weight_decay"]
    )

    scheduler = torch.optim.lr_scheduler.ReduceLROnPlateau(optimizer, mode='min', factor=0.5, patience=2)
    criterion = nn.CrossEntropyLoss()
    num_epochs= 20
    patience= 6

    # Train the model
    model, train_acc, val_acc, train_loss, val_loss = train_model(
        model, criterion, optimizer, scheduler,
        num_epochs, patience
    )

    # Save current run result
    result = {
        "run_name": run_name,
        "final_train_accuracy": train_acc[-1],
       # "final_val_accuracy": val_acc[-1],
        "final_val_accuracy": max(val_acc),
        "final_train_loss": train_loss[-1],
        "final_val_loss": val_loss[-1],
        **config  # unpack hyperparameters directly into the result
    }
    all_results.append(result)
    #Save results
    df = pd.DataFrame(all_results)
    df.to_csv(csv_path, index=False)

    #Plot training curves and save to file
    plot_training_curves(
        train_acc=train_acc,
        val_acc=val_acc,
        train_loss=train_loss,
        val_loss=val_loss,
        model_name=run_name
    )
    print(f"Finished {run_name} | Val Acc: {max(val_acc):.4f}")

# Print best result
best_row = df.sort_values(by="final_val_accuracy", ascending=False).iloc[0]
print("\nBest hyperparameters found:")
print(best_row)


